// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

contract Banking {
    uint256 public serialNumber = 0;
    uint256 public transacNum = 0;
    uint256 public bankBalance = 0;

    struct Account {
        uint256 serial;
        uint256 createAt;
        address creator;
        string _name;
        uint256 _balance;
        bool doesExist;
    }
    //Defining a struct to store transaction record
    struct Transaction {
        uint256 transacNum;
        uint256 currentBalance;
        uint256 amountTransacted;
        uint256 createdAt;
        string transacType;
        uint256 accountSerialNumber;
    }

    mapping(uint256 => Account) public accounts;
    mapping(uint256 => Transaction) public transactions;
    mapping(string => bool) public accountNameExists;

    string[] public accountNames;

    event AccountCreated(
        uint256 _serialNumber,
        bytes32 _name,
        bytes32 _location,
        uint256 _createdAt,
        uint256 _balance
    );

    event TransactionCompleted(
        uint256 _amount,
        uint256 _transacNumber,
        uint256 _currentAccountSerial,
        bytes32 _transactionType
    );

    function createAccount(address _creator, string memory _name)
        public
        payable
    {
        require(!accountNameExists[_name], "Account name already exists");
        accountNames.push(_name);
        serialNumber++;
        //// Create a new account and store it in the accounts mapping.
        accounts[serialNumber] = Account(
            serialNumber,
            block.timestamp,
            _creator,
            _name,
            0,
            true
        );
        transacNum++; /// increment the transaction number
        // // Create a new transaction new account and store it in the transactions mapping.
        transactions[transacNum] = Transaction(
            transacNum,
            2,
            2,
            block.timestamp,
            "NewAccount",
            serialNumber
        );
        emit TransactionCompleted(0, transacNum, serialNumber, "NewAccount"); // emit the event for new account creation
        accountNameExists[_name] = true;
    }

    function countTotalUserAccounts(address user)
        public
        view
        returns (uint256)
    {
        uint256 j = 1;
        for (uint256 i = 0; i < accountNames.length; i++) {
            if (accounts[i].creator == user) {
                j++;
            }
        }
        return j;
    }

    function getUserAccounts(address user)
        public
        view
        returns (Account[] memory)
    {
        uint256 k = 0;
        uint256 total_account = countTotalUserAccounts(user);
        Account[] memory accountsArray = new Account[](total_account);

        for (uint256 i = 0; i < accountNames.length; i++) {
            if (accounts[i].creator == user) {
                accountsArray[k] = accounts[i];
                k++;
            }
        }

        return accountsArray;
    }
}
